import React, { useState } from 'react';

const API_URL = 'http://localhost:5000/submit-application';

const Application = () => {
    const initialFormState = {
        email_address: '',
        address_line_1: '',
        address_country_code: '',
        phone_number: '',
        name_first: '',
        name_last: '',
        business_name: '',
        address_line_2: '',
        address_city: '',
        address_state: '',
        address_postal_code: '',
        document_ssn: '',
        document_ssn_last4: '',
        document_license: '',
        document_license_state: '',
        birth_date: '',
        user_consent: false
    };
    const [formData, setFormData] = useState(initialFormState);

    const [errors, setErrors] = useState({});
    const [message, setMessage] = useState('');

    const validateField = (name, value) => {
        let error = '';

        switch (name) {
            case 'email_address':
                error = /\S+@\S+\.\S+/.test(value) ? '' : 'Invalid email format';
                break;
            case 'phone_number':
                error = /^\d{10,15}$/.test(value) ? '' : 'Phone number must be 10-15 digits';
                break;
            case 'address_country_code':
                error = /^[A-Z]{2}$/.test(value) ? '' : 'Must be a 2-letter country code (ISO 3166-1)';
                break;
            case 'document_ssn':
                error = /^\d{9}$/.test(value) ? '' : 'SSN must be exactly 9 digits';
                break;
            case 'document_ssn_last4':
                error = /^\d{4}$/.test(value) ? '' : 'SSN last 4 must be exactly 4 digits';
                break;
            case 'birth_date':
                error = /^\d{4}-\d{2}-\d{2}$/.test(value) ? '' : 'Date must be in YYYY-MM-DD format';
                break;
            default:
                break;
        }

        return error;
    };

    const handleChange = (e) => {
        const { name, value, type, checked } = e.target;
        const newValue = type === 'checkbox' ? checked : value;

        setFormData({ ...formData, [name]: newValue });

        const error = validateField(name, newValue);
        setErrors({ ...errors, [name]: error });
    };

    const isValidForm = () => {
        const requiredFields = ['email_address', 'address_line_1', 'address_country_code', 'phone_number'];
        for (let field of requiredFields) {
            if (!formData[field]) return false;
        }

        if (!formData.business_name && (!formData.name_first || !formData.name_last)) {
            return false;
        }

        return Object.values(errors).every(error => !error);
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        if (!isValidForm()) {
            setMessage('Please fill in all required fields correctly.');
            return;
        }

        try {
            const response = await fetch(API_URL, {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify(formData),
            });

            const data = await response.json();
            if (response.ok) {
                setMessage(`Success: ${JSON.stringify(data)}`);
                setFormData(initialFormState);
            } else {
                setMessage(`Error: ${data.error || 'Failed to submit application'}`);
            }
        } catch (error) {
            setMessage('Error submitting application');
        }
    };

    return (
        <div>
            <h2>Application Form</h2>
            <form onSubmit={handleSubmit}>
                <label>Email Address*:</label>
                <input type="email" name="email_address" value={formData.email_address} onChange={handleChange} required />
                {errors.email_address && <p className="error">{errors.email_address}</p>}

                <label>Address Line 1*:</label>
                <input type="text" name="address_line_1" value={formData.address_line_1} onChange={handleChange} required />

                <label>Country Code (ISO 3166-1)*:</label>
                <input type="text" name="address_country_code" value={formData.address_country_code} onChange={handleChange} required />
                {errors.address_country_code && <p className="error">{errors.address_country_code}</p>}

                <label>Phone Number*:</label>
                <input type="text" name="phone_number" value={formData.phone_number} onChange={handleChange} required />
                {errors.phone_number && <p className="error">{errors.phone_number}</p>}

                <label>First Name:</label>
                <input type="text" name="name_first" value={formData.name_first} onChange={handleChange} />

                <label>Last Name:</label>
                <input type="text" name="name_last" value={formData.name_last} onChange={handleChange} />

                <label>Business Name:</label>
                <input type="text" name="business_name" value={formData.business_name} onChange={handleChange} />

                <label>SSN:</label>
                <input type="text" name="document_ssn" value={formData.document_ssn} onChange={handleChange} />
                {errors.document_ssn && <p className="error">{errors.document_ssn}</p>}

                <label>Birth Date (YYYY-MM-DD):</label>
                <input type="text" name="birth_date" value={formData.birth_date} onChange={handleChange} />
                {errors.birth_date && <p className="error">{errors.birth_date}</p>}

                <label>
                    <input type="checkbox" name="user_consent" checked={formData.user_consent} onChange={handleChange} />
                    I consent to the terms.
                </label>

                <button type="submit" disabled={!isValidForm()}>Submit</button>
            </form>
            {message && <p>{message}</p>}
        </div>
    );
};

export default Application;
